import React from "react";
import { Carousel, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import img1 from "assets/images/bg-about-us.jpg"

const Carrusel = () => {
  const images = [
    {
      id: 2,
      title: "Comienzos de integración a invernadero",
      src: {img1},
    },
    {
      id: 3,
      title: "Forma ejemplificada del invernadero",
      src: "assets/images/bg-about-us.jpg",
    },
  ];

  return (
    <Container>
      <Carousel>
        {images.map((image) => (
          <Carousel.Item key={image.id}>
            <img src={img1} alt="" fluid />
            <Carousel.Caption>
              <h3>{image.title}</h3>
            </Carousel.Caption>
          </Carousel.Item>
        ))}
      </Carousel>
    </Container>
  );
};

export default Carrusel;
